	// }, [getProject]);

	// if (!project) {
	// 	return null;
	// }

	const [compositions, setCompositions] = useState([]);

	const getCompositions = useCallback(() => {
		Axios.get("http://localhost:4000/4_0_0/Composition?subject=Patient/113610").then((response) => {
			if (isMountedRef.current) {
				console.log(response.data);
				setCompositions(response.data);
			}
		});
	}, [isMountedRef]);

	useEffect(() => {
		getCompositions();
	}, [getCompositions]);

	if (!compositions) {
		return null;
	}

	return (
		<Page className={classes.root} title="Project Details">
